import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import Menu from "@material-ui/core/Menu";
import MenuItem from "@material-ui/core/MenuItem";
import React from "react";

const Navigation = () => {
  const [anchorEl1, setAnchorEl1, anchorEl2, setAnchorEl2] = React.useState(null);

  const handleClick1 = (event) => {
    setAnchorEl1(event.currentTarget);
  };

  const handleClose1 = () => {
    setAnchorEl1(null);
  };

  const handleClick2 = (event) => {
    setAnchorEl2(event.currentTarget);
  };

  const handleClose2 = () => {
    setAnchorEl2(null);
  };

  return (
    <div>
      <div className="navBar">
        <img
          src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/logo_nqvtbv.png"
          alt=""
        />

        <TextField id="standard-basic" label="Buscar producto..." />

        <div className="options">
          <div className="optionMenu">
            <i class="ri-user-3-fill"></i>
            <p>Mi cuenta</p>
          </div>
          <div className="optionMenu">
            <i class="ri-heart-fill"></i>
            <p>Mis favoritos</p>
          </div>
          <div className="optionMenu">
            <i class="ri-upload-fill"></i>
            <p>Cargar pedido masivo</p>
          </div>
          <div className="optionMenu">
            <i class="ri-shopping-cart-2-fill"></i>
            <p>Mi carrito</p>
          </div>
        </div>
      </div>
      <div>
        <div className="menuDrop">
          <div>
              <Button
                aria-controls="simple-menu"
                aria-haspopup="true"
                onClick={handleClick1}
              >
                Marcas <i class="ri-arrow-drop-down-line"></i> 
              </Button>
              <Menu
                id="simple-menu"
                anchorEl1={anchorEl1}
                keepMounted
                open={Boolean(anchorEl1)}
                onClose={handleClose1}
              >
                <MenuItem onClick={handleClose1}>Profile</MenuItem>
                <MenuItem onClick={handleClose1}>My account</MenuItem>
                <MenuItem onClick={handleClose1}>Logout</MenuItem>
              </Menu>
          </div>
          <div>
              <Button
                aria-controls="simple-menu"
                aria-haspopup="true"
                onClick={handleClick2}
              >
                Departamentos <i class="ri-arrow-drop-down-line"></i> 
              </Button>
              <Menu
                id="simple-menu"
                anchorEl2={anchorEl2}
                keepMounted
                open={Boolean(anchorEl2)}
                onClose={handleClose2}
              >
                <MenuItem onClick={handleClose2}>Coflex</MenuItem>
                <MenuItem onClick={handleClose2}>Phillips</MenuItem>
                <MenuItem onClick={handleClose2}>Steren</MenuItem>
                <MenuItem onClick={handleClose2}>Teka</MenuItem>
                <MenuItem onClick={handleClose2}>Truper</MenuItem>
              </Menu>
          </div>
        </div>
        <div></div>
      </div>
    </div>
  );
};
export default Navigation;
